INSERT INTO `movies` (`MOVIE_ID`, `MOVIE_TITLE`, `MOVIE_DESC`, `MOVIE_DURATION`, `RATED`, `RATING_USER`, `RATING_TITLE`, `POSTER`, `POSTER_BG`, `TRAILER`, `PREMIERE_DATE`, `PRICE`, `ACTIVE`, `CREATED_ON`, `MODIFIED_ON`) VALUES
(1, 'Spiderman: Into the Spider-verse', 'Teen Miles Morales becomes the Spider-Man of his universe, and must join with five spider-powered individuals from other dimensions to stop a threat for all realities.', 117, 'PG', '8.4', 'tt4633694', 'T1-5ffbf873377c77.06527514.jpg', 'T1-BG-5ffbf87344cdd9.99531966.jpg', 'https://www.youtube.com/embed/g4Hbz2jLxvQ', '2021-01-11T00:00', 220, 2, '2021-01-11 15:04:19', '2021-01-11 16:15:14'),
(2, 'Jumanji: Welcome to the Jungle', 'Four teenagers are sucked into a magical video game, and the only way they can escape is to work together to finish the game.', 119, 'PG-13', '6.9', 'tt2283362', 'T1-5ffbfa52375475.53287835.png', 'T1-BG-5ffbfa526ae5e7.81251526.jpg', 'https://www.youtube.com/embed/2QKg5SZ_35I', '2021-01-31T00:00', 180, 1, '2021-01-11 15:12:17', '2021-01-11 15:59:24'),
(3, 'Star Wars: Revenge of the Sith', 'Three years into the Clone Wars, the Jedi rescue Palpatine from Count Dooku. As Obi-Wan pursues a new threat, Anakin acts as a double agent between the Jedi Council and Palpatine and is lured into a sinister plan to rule the galaxy.', 140, 'PG-13', '7.5', 'tt0121766', 'T1-5ffbfd57d93251.89698482.jpg', 'T1-BG-5ffbfd583ba844.82799827.jpg', 'https://www.youtube.com/embed/5UnjrG_N8hU', '2021-01-08T00:00', 150, 2, '2021-01-11 15:25:11', '2021-01-11 15:25:11'),
(4, 'One Piece: Gold', 'The Straw Hat Pirates come to Gran Tesoro, the richest ship in the world.', 120, 'PG', '7.2', 'tt5251328', 'T1-5ffbfe91eb4925.51741906.jpg', 'T1-BG-5ffbfe920f5649.13343607.jpg', 'https://www.youtube.com/embed/NmyGak3l12Y', '2021-01-10T00:00', 180, 2, '2021-01-11 15:30:25', '2021-01-11 16:15:33'),
(5, 'Si Agimat at si Enteng Kabisote', 'There is trouble brewing in the world of Agimat and monsters are scaring and kidnapping children. The monsters seem capable of travelling in other worlds and Agimat is able to crossover with them to Encantasia, the world of Faye, Ina Magenta and our hero, Enteng Kabisote. The fairies wonder why monsters are able to cross worlds. Agimat is amazed of the other world and hopes that things in his world would turn out better. His dream one day is to have a happy family like Enteng\'s. The story unfold', 110, 'PG', '5.3', 'tt1782526', 'T1-5ffc0057c7b135.17945020.jpg', 'T1-BG-5ffc0057f08291.22235755.jpg', 'https://www.youtube.com/embed/0nfOOQx7oHQ', '2021-02-03T00:00', 160, 1, '2021-01-11 15:37:59', '2021-01-11 15:37:59'),
(6, 'Suicide Squad', 'A secret government agency recruits some of the most dangerous incarcerated super-villains to form a defensive task force. Their first mission: save the world from the apocalypse.', 123, 'PG-13', '6.0', 'tt1386697', 'T1-5ffc018b065440.10203616.jpg', 'T1-BG-5ffc018b1ea048.27029401.png', 'https://www.youtube.com/embed/CmRih_VtVAs', '2021-01-09T00:00', 200, 2, '2021-01-11 15:43:06', '2021-01-11 15:43:06'),
(7, 'Ang babae sa septic tank', 'Jocelyn, Rainier, and Bingbong are three film school graduates who are dead set on making an Oscar-worthy film. They set out to do a quick pre-production as a courtesy call to their lead actress played by Eugene Domingo, and a through inspection of their film\'s major location, the Payatas dumpsite. They believe they have a winning script, and the energy and drive to make their dreams come true, no matter what the cost.', 87, 'PG', '7.0', 'tt1961179', 'T1-5ffc027d60db87.92180664.jpg', 'T1-BG-5ffc027d693813.39203063.jpeg', 'https://www.youtube.com/embed/fqDG_P96Rb0', '2021-01-01T00:00', 170, 2, '2021-01-11 15:47:09', '2021-01-11 15:47:09'),
(8, 'The Shining', 'A family heads to an isolated hotel for the winter where a sinister presence influences the father into violence, while his psychic son sees horrific forebodings from both past and future.', 146, 'R', '8.4', 'tt0081505', 'T1-5ffc03bfa698e9.36917262.jpg', 'T1-BG-5ffc03bfae9da1.52570443.jpg', 'https://www.youtube.com/embed/WDpipB4yehk', '2021-01-07T15:52', 160, 2, '2021-01-11 15:52:31', '2021-01-11 15:52:31'),
(9, 'Parasite', 'Greed and class discrimination threaten the newly formed symbiotic relationship between the wealthy Park family and the destitute Kim clan.', 132, 'R', '8.6', 'tt6751668', 'T1-5ffc04e502dff8.42152733.jpg', 'T1-BG-5ffc04e559c5d6.68083198.jpg', 'https://www.youtube.com/embed/SEUXfv87Wpk', '2021-01-28T15:57', 200, 1, '2021-01-11 15:57:24', '2021-01-11 15:57:24'),
(10, 'The Hows of Us', 'A young couple dream of growing old together as they as they deal with the struggles of being in a long-term relationship.', 117, 'PG-13', '7.3', 'tt8769032', 'T1-5ffc06753b7fd9.24973232.jpg', 'T1-BG-5ffc06754b7d63.25778359.jpg', 'https://www.youtube.com/embed/9C5w28q6JgA', '2021-01-26T16:03', 180, 1, '2021-01-11 16:04:05', '2021-01-11 16:04:05'),
(11, 'Joker', 'In Gotham City, mentally troubled comedian Arthur Fleck is disregarded and mistreated by society. He then embarks on a downward spiral of revolution and bloody crime. This path brings him face-to-face with his alter-ego: the Joker.', 122, 'R', '8.5', 'tt7286456', 'T1-5ffc0782730883.81450340.jpg', 'T1-BG-5ffc07827b0839.14400315.jpg', 'https://www.youtube.com/embed/zAGVQLHvwOY', '2021-01-11T16:08', 220, 2, '2021-01-11 16:08:34', '2021-01-11 16:08:34'),
(12, 'Harry Potter and the Deathly Hallows Part 2', 'Harry, Ron, and Hermione search for Voldemort\'s remaining Horcruxes in their effort to destroy the Dark Lord as the final battle rages on at Hogwarts.', 130, 'PG-13', '8.1', 'tt1201607', 'T1-5ffc08f09dd018.79474377.jpg', 'T1-BG-5ffc08f0adc6b7.55583760.jpg', 'https://www.youtube.com/embed/5NYt1qirBWg', '2021-01-30T16:14', 180, 1, '2021-01-11 16:14:40', '2021-01-11 16:14:40');
